The Alex Jones Show

Friday January 09, 2009.

Alex talks with Lakota tribal leader and former nominee of the Libertarian Party for president Russell Means. On December 20, 2007, Means announced the withdrawal of a group of Lakota Sioux from all treaties with the United States government and declared the Lakota a sovereign nation. Alex also talks with regular guest Bob Chapman of the International Forecaster and New World Order researcher, author, and radio talk show host Alan Watt. Alex also discusses the important issues of the day and takes your calls. 

Hour-1: News and Russell Means
Hour-2: Bob Chapman
Hour-3: Bob Chapman then Alan Watt
Hour-4: Alan Watt
